description:
Verenigde Staten
Horror
95 minuten

goed

met Kristen Connolly, Richard Jenkins en Chris Hemsworth

Vijf twintigers besluiten om een weekendje in een afgelegen hut te spenderen, midden in het bos. Al gauw wordt duidelijk dat 
de vijf - drie mannen, twee vrouwen - meer op hun bord krijgen dan een idyllisch uitje alleen. Het oplezen van een spreuk uit 
een dagboek leidt tot dood en verderf en allerlei bizarre gevolgen van dien.
